import React from "react";
import "../index.css";

const Navbar = () => {
  return (
    <header className="header">
      <navbar className="navbar">
        <ul>
          <li>TMDB</li>
          <li>Movies</li>
          <li>Tv Shows</li>
          <li>People</li>
        </ul>
      </navbar>
      <div>
        <p>Login</p>
      </div>
    </header>
  );
};

export default Navbar;
